import React from 'react';
import './App.css';
import ChatBot from './components/ChatBot';

function App() {
  return (
    <div className="App" style={{ padding: '20px' }}>
      <h2>Restaurant Chatbot</h2>
      <ChatBot />
    </div>
  );
}

export default App;
